import React from "react";

import styled from "styled-components";
import Topbar from "../Layout/Topbar/Topbar";

const Home = styled.div`
    height: 100%;
    width: 100vw;
`;

const HomeComponent: React.FC<{}> = () => {

    return (<Home>
        <Topbar />
    </Home>)
}

export default HomeComponent;
